import React from "react";
import ExpenseItem from "./ExpenseItem";

const ExpensesList = props => {
  let expensesContent = <p>No expenses found.</p>; // pode se usar JSX em variaveis!

  if (props.expenses.length > 0){
    expensesContent = props.expenses.map((expenseFilteredByYear) => (
      <ExpenseItem
        key={expenseFilteredByYear.id}
        title={expenseFilteredByYear.title}
        amount={expenseFilteredByYear.amount}
        date={expenseFilteredByYear.date}
      />
    ));
  }

  return (
    <ul className="expenses-list">

    </ul>
  )
}

export default ExpensesList;
